import React from "react";
import styled from "styled-components";

const Chart = styled.svg`
  height: 50vh;
  z-index: -1;

  &.techHolder__chart {
    fill: none;
    stroke: #4cc790;
    stroke-linecap: round;
    stroke-width: 1.8;
    stroke-dasharray: ${(props) => props.percent || 0} 100;
    stroke-dashoffset: -200;
  }

  & > .techHolder__chartbase {
    fill: none;
    stroke: #444;
    stroke-width: 1.8;
  }
`;

const ChartDesc = styled.div`
  position: absolute;
  text-align: center;
  left: 50%;
  top: 50%;
  transform: translate(-50%, -50%);
`;

export default function ContributionChart(props) {
  return (
    <div
      className="ChartContainer"
      style={{ margin: "auto", position: "relative" }}
    >
      <Chart
        className="techHolder__chart"
        percent={props.percent}
        viewBox="0 0 36 36"
      >
        <path
          d="M18 2.0845
            a 15.9155 15.9155 0 0 1 0 31.831
            a 15.9155 15.9155 0 0 1 0 -31.831"
        />
        <path
          className="techHolder__chartbase"
          d="M18 2.0845
            a 15.9155 15.9155 0 0 1 0 31.831
            a 15.9155 15.9155 0 0 1 0 -31.831"
        />
      </Chart>
      <ChartDesc className="techHolder__desc">
        MY JOB<br></br>
        뭐시기<br></br>
        뭐시기<br></br>
        뭐시기<br></br>
        <br></br>
        WITH TEAM<br></br>
        저시기
      </ChartDesc>
    </div>
  );
}
